const Home = () => {
  const { isLoggedIn } = useSelector((state: any) => state.user);
  return (
    // 다른 컴포넌트로 감싸줄 경우 다른 컴포넌트 사용 가능
    <AppLayout>
      <PostForm />
      <PostCard />
    </AppLayout>
  );
};

export default Home;
